import React, { Component } from "react";
import PharmacistPicture from "../../Images/pharmacist.png" ;
import Axios from "axios";
import GetAuthorisation from "../../Funciton/GetAuthorisation";




const API_URL="http://localhost:8080";

class FoundPharmacistForPharmacyForDateRange extends Component {
	
    
    
    render() {
		return (
			<div hidden={this.props.hiddenPharmacist}>

                <div className="container">
                <button type="button" class="btn btn-link btn-lg" style={{ width: "100px" , marginTop: "40px"}}>
                     <i className="arrow-left" ></i>
                     
                          Back
                </button>

                </div>


				<div className="container">
                    
                    <table className="table table-hover" style={{ width: "90%", marginTop: "5em", marginLeft: "auto",marginRight: "auto" }}>
                                  <tbody>
                                      {this.props.pharmacists.map((pharmacy) => (
                                          <tr
                                              id={pharmacy.Id}
                                              key={pharmacy.Id}
                                              style={{ cursor: "pointer" }}
                                          >
          
                                            <td width="100px">  
                                            <img  src={PharmacistPicture} style={{ width: "85px" }}></img>                                 
                                                            
                                            </td>
                                              
                                              <td>
                                                            
                                                    <div>
                                                        <b>Name: </b> {pharmacy.EntityDTO.name}
                                                    </div>
                                                    <div>
                                                        <b>Surname: </b>{pharmacy.EntityDTO.surname}
                                                    </div>

                                                    

                                                    <div>
                                                        <b>Grade: </b> {pharmacy.EntityDTO.grade}
                                                        <i className="icon-star" style={{ color: "yellow"}}></i>
                                                    </div>
                                            
                                                  
                                              </td>

                                            <td>
                                                <button
                                                        type="button"
                                                        className="btn btn-outline-primary"
                                                        style={{  marginTop: "25px" }}
                                                        onClick={() => this.props.reserveAppointmentForPharmacist(pharmacy)}
                                                >
                                                        Reserve consultation
                                                </button>
                                            </td>



                                          </tr>
                                      ))}
                                  </tbody>
                              </table>
                    </div>
			</div>
		);
	}
}

export default FoundPharmacistForPharmacyForDateRange;
